      text: "\n Unterscheidung between direct and indirect speech in English grammar.\
        \ In direct speech, the exact words of the speaker are repeated, while in\
        \ indirect speech, the content of the speaker's message is conveyed through\
        \ a reporting verb. Both forms have their own set of rules and conventions\
        \ to follow. Here are some key differences:\nDirect Speech:\n\u2022 The exact\
        \ words of the speaker are repeated exactly as they were spoken. \u2022 The\
        \ verb tense must match the verb tense of the original sentence. \u2022 Commas\
        \ or quotation marks are used to set off the direct speech.\nIndirect Speech:\n\
        \u2022 The content of the speaker's message is conveyed through a reporting\
        \ verb, such as \"he said,\" \"she told,\" or \"they exclaimed.\" \u2022 The\
        \ verb tense changes to match the time frame of the reported statement. \u2022\
        \ No quotation marks are used in indirect speech.\nHere is an example of direct\
        \ and indirect speech:\nDirect Speech:\n\"I love spending time with my family,\"\
        \ she said with a big smile. (Exact words of the speaker repeated)\nIndirect\
        \ Speech:\nShe told us that she loves spending time with her family. (Reporting\
        \ verb used to convey the content of the original sentence)\nIn conclusion,\
        \ understanding the difference between direct and indirect speech can help\
        \ you communicate more effectively in English. By following the rules and\
        \ conventions for each form, you can accurately convey the intended meaning\
        \ of a statement or quote, while avoiding confusion or miscommunication."
